import React from 'react'
import Card from './Card'
import { CreateCardData } from '../data/CreateCardData.js'

const CardList = () => {


	const newArray = CreateCardData.filter(obj => !obj.answered);

	const finalArray = newArray.map((card, i) => {
		return (
			<Card id={CreateCardData[i].id}
			question={CreateCardData[i].question}
			dataEntryId={CreateCardData[i].dataEntryId}
			buttonText={CreateCardData[i].buttonText}
			/>
			)
	});


	console.log(finalArray)


	return(

		<div>

			{finalArray}

		</div>
	)

}

export default CardList
